import React, { Component } from 'react';
import Header from './components/Header'
import Main from './pages/main'
import TitlebarGridList from './pages/teste/TitlebarGridList'

class App extends Component{
  render() {
  return (
    <div className="App">
      <Header/>
      <Main/>
      <TitlebarGridList/>
    </div>
  );
}}

export default App;
